import React, { useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';


const DisposeForm = () => {
    const { itemType } = useParams();
    const navigate = useNavigate();
    const [brand, setBrand] = useState('');
    const [yearsUsed, setYearsUsed] = useState('');
    const [description, setDescription] = useState('');
    const [image, setImage] = useState(null);

    const handleSubmit = async (e) => {
        e.preventDefault();

        // Prepare form data to be sent to the backend
        const formData = new FormData();
        formData.append('brand', brand);
        formData.append('yearsUsed', yearsUsed);
        formData.append('description', description);
        formData.append('image', image);

        try {
            // Send form data to the backend
            const response = await fetch(`http://localhost:8090/api/v1/items/${itemType.toLowerCase()}`, {
                method: 'POST',
                body: formData,
                headers: {
                    'Accept': 'application/json', // Ensure the response is handled correctly
                },
            });

            if (!response.ok) {
                throw new Error('Network response was not ok');
            }

            const data = await response.json();
            console.log('Success:', data);
            navigate('/dispose'); // Redirect after successful submission
        } catch (error) {
            console.error('Error:', error);
        }
    };

    const modernStyles = {
        container: {
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
            backgroundColor: '#f5f5f5',
        },
        card: {
            width: '80%',
            boxShadow: '0 2px 8px rgba(0, 0, 0, 0.1)',
            borderRadius: '8px',
            padding: '20px',
            backgroundColor: '#fff',
        },
        formGroup: {
            marginBottom: '15px',
        },
        formControl: {
            padding: '10px',
            borderRadius: '4px',
            border: '1px solid #ddd',
            width: '100%',
        },
        btn: {
            padding: '10px 20px',
            borderRadius: '4px',
            border: 'none',
            cursor: 'pointer',
            fontSize: '16px',
            margin: '10px 0',
        },
        btnSubmit: {
            backgroundColor: '#007bff',
            color: '#fff',
        },
        btnCancel: {
            backgroundColor: '#dc3545',
            color: '#fff',
            marginLeft: '10px',
        },
    };

    return (
        <div style={modernStyles.container}>
            <h1>Dispose {itemType}</h1>
            <br /><br />
            <div style={modernStyles.card}>
                <h2 className="text-center">Dispose {itemType}</h2>
                <div className="card-body">
                    <form onSubmit={handleSubmit}>
                        <div style={modernStyles.formGroup}>
                            <label className="form-label">Brand:</label>
                            <input
                                type="text"
                                placeholder="Enter brand"
                                name="brand"
                                style={modernStyles.formControl}
                                value={brand}
                                onChange={(e) => setBrand(e.target.value)}
                            />
                        </div>

                        <div style={modernStyles.formGroup}>
                            <label className="form-label">Number of Years Used:</label>
                            <input
                                type="number"
                                placeholder="Enter number of years used"
                                name="yearsUsed"
                                style={modernStyles.formControl}
                                value={yearsUsed}
                                onChange={(e) => setYearsUsed(e.target.value)}
                            />
                        </div>

                        <div style={modernStyles.formGroup}>
                            <label className="form-label">Description:</label>
                            <textarea
                                placeholder="Enter description"
                                name="description"
                                style={modernStyles.formControl}
                                value={description}
                                onChange={(e) => setDescription(e.target.value)}
                            />
                        </div>

                        <div style={modernStyles.formGroup}>
                            <label className="form-label">Upload Image:</label>
                            <input
                                type="file"
                                name="image"
                                style={modernStyles.formControl}
                                onChange={(e) => setImage(e.target.files[0])}
                            />
                        </div>

                        <button 
                            type="submit" 
                            style={{ ...modernStyles.btn, ...modernStyles.btnSubmit }}
                        >
                            Submit
                        </button>
                        <button 
                            type="button" 
                            style={{ ...modernStyles.btn, ...modernStyles.btnCancel }}
                            onClick={() => navigate('/dispose')}
                        >
                            Cancel
                        </button>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default DisposeForm;
